import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <body>
        <header>
          <div>
            <nav>
              <ul>
                <li><a href= "#">Home</a></li>
                <li><a href="#">Inventory</a></li>
                <li><a href= "#">Alerts</a></li>
                <li><a href="#">Add Item</a></li>
                <li><a href= "#">Ordering</a></li>
                <li><a href= "#">Metrics</a></li>
                <li><a href="#">Settings</a></li>
              </ul>
            </nav>
          </div>
        </header>
      </body>
    </div>
  );
}

export default App;
